import Card from "../UI/Card";
import './'
const UsersList = ({ users }) => {
  console.log("in UserList ", users);
  if (users.length === 0) {
    return <p>there is no users</p>;
  }

  return (
    <Card>
      <ul>
        {users.map((user) => (
          <li key={user.userName}> {`${user.userName} ${user.age}`}</li>
        ))}
      </ul>
    </Card>
  );
};

export default UsersList;
